package com.amdocs.tenbis.controller;

import java.io.FileNotFoundException;
import java.io.IOException;
import java.util.ArrayList;
import java.util.Calendar;
import java.util.List;

import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.context.ApplicationContext;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.RestController;

import com.amdocs.tenbis.model.SecurityEvent;
import com.google.gson.Gson;

@RestController
public class SecurityController {
	@Autowired
    private ApplicationContext applicationContext;
	
	
	@RequestMapping("/getSecurityEvents")
	public String getEvents() throws FileNotFoundException, IOException {
//		TenBisDB db = applicationContext.getBean(TenBisDB.class);
		List<SecurityEvent> events = new ArrayList<>();
		events.add(getEvent());
		events.add(getEvent());
		events.add(getEvent());
		events.add(getEvent());
		events.add(getEvent());
		Gson gson = new Gson();
		return gson.toJson(events, List.class);
	}

	private SecurityEvent getEvent() {
		SecurityEvent securityEvent = new SecurityEvent();
		securityEvent.setImgUrl("data:image/jpeg;base64,");
		securityEvent.setLat(32.707126);
		securityEvent.setLon(35.301647);
		securityEvent.setTime(Calendar.getInstance().getTime());
		securityEvent.setType("Crash!");
		return securityEvent;
	}

}
